import './App.css';
import { BrowserRouter as Router,Route,Routes} from 'react-router-dom';
import { UserForm } from './component/UserForm';
import { UserData } from './component/UserData';
function App() {

  return (
    <Router>
      <UserForm/>
      <Routes>

      <Route path="/userProfiles" component={UserData} />
      </Routes>

    </Router>

  );
}

export default App;
